import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';

// Importing the components for Login, Register, and Main Page
import Login from './Login'; // Ensure Login.js is in the same directory or adjust the path
import Register from './Register'; // Ensure Register.js is in the same directory or adjust the path
import MainPage from './MainPage'; // Assuming you have a MainPage component, otherwise create it

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<MainPage />} /> {/* Main Page Route */}
          <Route path="/login" element={<Login />} /> {/* Login Route */}
          <Route path="/register" element={<Register />} /> {/* Register Route */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
